add('OcculTango', 'http://occultango.smackjeeves.com/comics/', u'OcculTango official site: http://occultango.comicgenesis.com Imagine waking up in the middle of a forest with no memory but your name. Add on top of that, being captured by a native tribe and having a heavy, irremovable chain stuck around your arm. To make matters worse, once you manage to escape the tribe, you\'re attacked by a giant falcon monster and saved by your captors. That\'s Kael\'s life now--or death, as Duscan likes to point out. OcculTango is a story about Kael exploring the purgatory he has now become citizen to in order to solve the mystery of his death and bring his soul to its final resting place. OcculTango is a graphic novel about revenge, forgiveness, and saving your soul. More than that, it is an exploration on when--or if--it becomes too late to say, "I\'m sorry."', False, True)
